import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Tableta from './componentes/TableNew';

function App() {
  return (
    <Router>
      <Routes>
        <Route path='/' element={<Tableta/>} />
        <Route path='/pokemon/:name' element={<></>}/>
      </Routes>
    </Router>
  )
}

export default App;
